import React from 'react'

function login() {
  return (
    <div>
        
        <form action="">
            <input type="text" placeholder='Enter Username/Email' />
            <input type="password" placeholder='Enter Password' />
            <input type="submit" placeholder='Login' />
        </form>
    </div>
  )
}

export default login
